const List = () => {
  return (
    <div>
      <header>
        <p>
          Things to do <span>soon</span>
        </p>
      </header>
      <p>Interesting things I want to check out</p>
      <section>
        <article><h2></h2></article>
        <article>Movies</article>
        <article>Games</article>
      </section>
    </div>
  );
};

export default List;
